import "./Navbar.css";

function navBar() {
  return (
    <nav>
      <div className="nav-container">
        <input
          type="text"
          className="saerch-input"
          placeholder="Nhập tên/hãng giày cần tìm."
        />
      </div>
      <div className="profile-container"></div>
    </nav>
  );
}

export default navBar;
